CREATE PROCEDURE [dbo].[sp_reclasificacion_manual_2]
AS 
BEGIN
DECLARE @rManual TABLE
(
	[Id] INT,
	[identificacion] [nvarchar](255) NULL,
	[tipoAccion] INT NULL,
	[acciones] [float] NULL,
	[reclasificacion] [money] NULL,
	[fechaExDividendo] DATETIME NULL
);
SET DATEFORMAT dmy
INSERT INTO @rManual(Id,identificacion,tipoAccion,acciones,reclasificacion,fechaExDividendo)
SELECT Id,identificacion,IIF(tipoAccion=N'A',19,20),acciones,reclasificacion,CAST(fechaExDividendo AS DATETIME) FROM #reclasificacionManual;

DECLARE @count INT = (select COUNT(*) from @rManual);
WHILE	@count > 0
BEGIN

	DECLARE @id INT				= (SELECT TOP(1) Id from @rManual order by Id);
	DECLARE @Acc VARCHAR(max)	= (SELECT TOP(1) [identificacion] from @rManual order by Id);
	DECLARE @IdAccionista INT	= (SELECT TOP(1) Id FROM Accionista WHERE NumIdentificacion = @Acc );
	DECLARE @tipoAccion INT		= (SELECT TOP(1) [tipoAccion] FROM @rManual order by Id);
	DECLARE @Acciones INT		= (SELECT TOP(1) [acciones] from @rManual order by Id);
	DECLARE @rcl MONEY			= (SELECT TOP (1) [reclasificacion] from @rManual order by Id);
	DECLARE @fechaE DATETIME	= (SELECT TOP (1) [fechaExDividendo] from @rManual order by Id);

	UPDATE d SET d.Reclasificacion=(d.Reclasificacion+@rcl),d.ValorMonto=(d.ValorMonto-@rcl) FROM decretar d  
	INNER JOIN DetalleAccion da ON d.IdDetalleAccion=da.Id
	WHERE d.IdAccionista=@IdAccionista AND da.IdTipoAccion=@tipoAccion AND d.AccionesSinRepo=@Acciones
	AND da.IdEmisor=7 AND d.NumeroDividendo=0 AND d.Eliminado=0;

	INSERT INTO DividendoHistorico(IdAccionista, FechaExDividendo, IdTipoAccion, ValorAPagar, Reclasificado, IdEmisor, CargueReclasificacion) VALUES (@IdAccionista,@fechaE,@tipoAccion,@rcl,N'S',7,1);

	DELETE @rManual WHERE Id=@id; 
    SET @count = (select count(*) from @rManual);
END;
END

